INSERT INTO `watch` (`id`, `name`, `brand`, `color`, `price`, `stock`, `image`, `image_type`, `spec1`, `spec2`, `spec3`, `spec4`, `spec5`, `spec6`, `description`) VALUES
(1, 'Rolex Daytona \"Rainbow\"', 'Rolex', 'Gold', 15000, 10, , 'image/jpeg', '40mm 18k Everose gold case with screw-down pushers\r\n', 'Graduated rainbow sapphire bezel (36 stones)', 'Diamond-paved dial with sapphire accents', '100m water resistance', 'COSC-certified chronograph movement', 'Oysterflex bracelet with Everose gold clasp', 'The ultimate expression of horological flamboyance, this Daytona\r\ntransforms precious metals and gemstones into a symphony of color. The 18k Everose\r\ngold case serves as a canvas for 36 vividly graded sapphires on the bezel, perfectly\r\ntransitioning from ruby red to violet like an actual rainbow. The dial features 11\r\ndiamond-set hour markers with sapphire accents, while the chronograph subdials\r\nmaintain perfect legibility despite the extravagance. The Oysterflex bracelet combines\r\nthe elegance of rose gold with the practicality of a flexible metal blade and black\r\nelastomer coating. This isn\'t just a watch - it\'s wearable art that celebrates life\'s most\r\nvibrant moments.');
INSERT INTO `watch` (`id`, `name`, `brand`, `color`, `price`, `stock`, `image`, `image_type`, `spec1`, `spec2`, `spec3`, `spec4`, `spec5`, `spec6`, `description`) VALUES
(2, 'Patek Philippe Nautilus 5711/1A-010', 'Patek Philippe', 'Silver', 120000, 10, , 'image/jpeg', '40mm stainless steel case with polished/brushed finishing\r\n', 'Ultra-thin 324 SC automatic movement with 45-hour power reserve', 'Signature horizontally embossed blue dial with luminous markers', '120m water resistance despite slim profile', 'Integrated bracelet with patented fold-over clasp', 'Discontinued status making it a true collector\'s item', 'The legendary Nautilus 5711 represents the ultimate expression of\r\nunderstated luxury in stainless steel. Designed by the legendary Gerald Genta in 1976,\r\nthis masterpiece combines the robustness of a sports watch with the refinement of\r\nhaute horlogerie. The iconic porthole-shaped case with its distinctive horizontal grooves\r\nhas become a symbol of status among watch connoisseurs. The mesmerizing\r\nblue-gradient dial, with its subtle sunburst pattern, changes character from deep navy to\r\nvibrant cobalt depending on the light. The ultra-thin self-winding movement can be\r\n\r\nadmired through the sapphire case back, revealing Patek Philippe\'s signature Geneva\r\nStripes finishing.');
INSERT INTO `watch` (`id`, `name`, `brand`, `color`, `price`, `stock`, `image`, `image_type`, `spec1`, `spec2`, `spec3`, `spec4`, `spec5`, `spec6`, `description`) VALUES
(3, 'Audemars Piguet Royal Oak Perpetual Calendar', 'Audemars Piguet', 'Black', 89000, 10, , 'image/jpeg', 'Grade 5 titanium case and bracelet for lightweight durability\r\n', 'Genuine perpetual calendar complication (day/date/month/moonphase)', 'Signature \"Petite Tapisserie\" dial pattern with luminescent markers', '41mm diameter with just 9.5mm thickness despite complications', '38-hour power reserve with 22k gold rotor', 'Water resistant to 20m despite complex movement', 'This horological masterpiece elevates the iconic Royal Oak to new\r\nheights of technical sophistication. The 41mm titanium case maintains the collection\'s\r\nsignature octagonal bezel secured by eight hexagonal white gold screws, but now\r\nhouses one of watchmaking\'s most prestigious complications - the perpetual calendar.\r\nThe stunning blue \"Grande Tapisserie\" dial features subdials displaying the day, date,\r\nmonth, astronomical moonphase, and even the leap year cycle, all perfectly balanced\r\nwithin the avant-garde design. The openworked hands and applied markers float above\r\nthe intricate guilloché pattern, while the ultra-thin self-winding caliber 5134 can be\r\nadmired through the exhibition case back. This watch doesn\'t just tell time - it chronicles\r\neternity, requiring no date adjustment until the year 2100.');
INSERT INTO `watch` (`id`, `name`, `brand`, `color`, `price`, `stock`, `image`, `image_type`, `spec1`, `spec2`, `spec3`, `spec4`, `spec5`, `spec6`, `description`) VALUES
(4, 'Richard Mille RM 011 Felipe Massa', 'Richard Mille', 'Black', 250000, 1, , 'image/jpeg', '50x40mm NTPT carbon case with red gold accents', 'Flyback chronograph with annual calendar', 'Skeletonized movement with 55-hour power reserve', 'Variable inertia balance wheel', 'Quick-release strap system', '', 'A technical tour de force inspired by Formula 1 engineering, this watch\r\nweighs less than 40 grams yet withstands 5,000 Gs of acceleration. The\r\ntonneau-shaped case combines NTPT carbon and red gold for unprecedented\r\nstrength-to-weight ratio. The skeletonized dial reveals a flyback chronograph movement\r\nwith annual calendar and 60-minute countdown timer, its gears and springs resembling\r\na high-performance engine. The variable inertia balance wheel ensures precision\r\nwhether you\'re on the golf course or in a race car, protected by a suspension system\r\ninspired by automotive shock absorbers.');
INSERT INTO `watch` (`id`, `name`, `brand`, `color`, `price`, `stock`, `image`, `image_type`, `spec1`, `spec2`, `spec3`, `spec4`, `spec5`, `spec6`, `description`) VALUES
(5, 'Vacheron Constantin Overseas Tourbillon', 'Vacheron Constantin', 'Gold', 180000, 3, , 'image/jpeg', '42.5mm 18k pink gold case\r\n', 'Ultra-thin flying tourbillon movement\r\n', 'Three interchangeable straps (leather/rubber/metal)', '80-hour power reserve', 'Geneva Hallmark certification', '', 'Geneva\'s oldest watchmaker presents its most technically advanced\r\nsports watch, where the tourbillon seems to float above a guilloché blue dial like a\r\ncelestial body. The 42.5mm pink gold case frames this mechanical ballet, with the\r\nMaltese cross-inspired bezel reflecting light from every angle. The ultra-thin (5.65mm)\r\nmovement contains 216 components in the tourbillon cage alone, yet remains water\r\nresistant to 50 meters. The interchangeable strap system transforms it from\r\nrubber-banded sporty to leather-strapped elegant in seconds.');
INSERT INTO `watch` (`id`, `name`, `brand`, `color`, `price`, `stock`, `image`, `image_type`, `spec1`, `spec2`, `spec3`, `spec4`, `spec5`, `spec6`, `description`) VALUES
(6, 'A. Lange & Söhne Zeitwerk Minute Repeater', 'A. Lange & Söhne', 'Silver Black', 500000, 3, , 'image/jpeg', '44.2mm platinum case\r\n', 'Jumping numerals with decimal minute repeater', 'Twin mainspring barrels', '36-hour power reserve', 'Hand-engraved balance bridge', '', 'German precision meets musical horology in this decimal minute repeater\r\nthat chimes the time at the push of a button. The solid silver dial features jumping\r\nnumerals for hours and minutes, framed by a hand-engraved balance cock visible\r\nthrough the sapphire caseback. When activated, tiny hammers strike gongs tuned to\r\ndifferent pitches - low for hours, high for minutes - creating a cathedral-like resonance.\r\nThe 44.2mm platinum case houses 771 components, each finished to microscopic\r\nperfection.');
INSERT INTO `watch` (`id`, `name`, `brand`, `color`, `price`, `stock`, `image`, `image_type`, `spec1`, `spec2`, `spec3`, `spec4`, `spec5`, `spec6`, `description`) VALUES
(7, 'Jaeger-LeCoultre Reverso Tribute Monoface', 'Jaeger-LeCoultre', 'White', 9250, 3, , 'image/jpeg', '45.6x27.4mm stainless steel reversible case\r\n', 'Hand-wound mechanical movement', 'Solid silver sunburst dial', 'Small seconds at 6 o\'clock', '30m water resistance', '', 'The Art Deco icon returns with this sunburst blue dial version that\r\ncaptures changing light like liquid metal. The reversible case (originally designed for\r\npolo players) features crisp gadroons along the sides and a flawless brushed/polished\r\nfinish. The manual-wind movement ticks discreetly behind the solid silver dial, its small\r\nseconds subdial adding dynamic balance. Wearing this is like carrying a piece of 1930s\r\nParisian elegance on your wrist.');
INSERT INTO `watch` (`id`, `name`, `brand`, `color`, `price`, `stock`, `image`, `image_type`, `spec1`, `spec2`, `spec3`, `spec4`, `spec5`, `spec6`, `description`) VALUES
(8, 'Hublot Big Bang Unico Sapphire', 'Hublot ', 'White', 75000, 2, , 'image/jpeg', '45mm sapphire crystal case\r\n', 'Skeletonized Unico chronograph movement', '72-hour power reserve', 'Transparent rubber strap', '50m water resistance', '', 'A futuristic skeleton watch encased in transparent sapphire crystal,\r\nrevealing the intricate Unico HUB1242 movement like a mechanical x-ray. The 45mm\r\ncase is milled from a single block of synthetic sapphire, requiring over 100 hours of\r\nmachining. The openworked dial exposes the column-wheel chronograph mechanism\r\nand oscillating weight, with luminescent markers floating on the crystal\'s edge. Wearing\r\nthis feels like having a miniature engine strapped to your wrist - one that happens to be\r\ncompletely see-through.');
INSERT INTO `watch` (`id`, `name`, `brand`, `color`, `price`, `stock`, `image`, `image_type`, `spec1`, `spec2`, `spec3`, `spec4`, `spec5`, `spec6`, `description`) VALUES
(9, 'Omega Speedmaster Moonwatch Professional', 'Omega', 'Silver', 6300, 2, , 'image/jpeg', '42mm stainless steel case\r\n', 'Manual-wind Master Chronometer movement', 'Hesalite crystal with date magnifier', 'Tachymeter bezel in black aluminum', '50m water resistance', '', 'The only watch certified by NASA for extravehicular activity, this legend\r\naccompanied astronauts on all six moon landings. The 42mm stainless steel case\r\nhouses the manual-wind Calibre 3861 with Co-Axial escapement, visible through the\r\nhesalite crystal that\'s more shatter-resistant than sapphire in space. The black step dial\r\n\r\nfeatures superluminova-coated indexes and the iconic dot-over-90 bezel. More than a\r\ntimepiece, it\'s a piece of human history that continues to fly on Artemis missions today.');
INSERT INTO `watch` (`id`, `name`, `brand`, `color`, `price`, `stock`, `image`, `image_type`, `spec1`, `spec2`, `spec3`, `spec4`, `spec5`, `spec6`, `description`) VALUES
(10, 'Cartier Santos-Dumont XL', 'Cartier', 'Silver', 7600, 3, , 'image/jpeg', '46.6x33.9mm stainless steel case\r\n', 'Guilloché silver dial with Roman numerals', 'QuickSwitch interchangeable strap system', 'Sapphire crystal caseback', '30m water resistance', '', 'The world\'s first pilot\'s watch (1904) reimagined for modern wrists,\r\nblending Parisian elegance with aviation heritage. The square 46.6mm case features\r\nexposed screws inspired by the Eiffel Tower\'s rivets, framing a guilloché silver dial with\r\nRoman numerals and sword-shaped hands. The ultra-thin quartz movement hides\r\nbeneath the sapphire crystal, while the quick-change strap system allows instant\r\ntransformation from alligator leather to metal bracelet. A timeless design that works\r\nequally well with a tuxedo or flying jacket.');
INSERT INTO `watch` (`id`, `name`, `brand`, `color`, `price`, `stock`, `image`, `image_type`, `spec1`, `spec2`, `spec3`, `spec4`, `spec5`, `spec6`, `description`) VALUES
(11, 'Breguet Classique Tourbillon Extra-Plat 5367', 'Breguet', 'Silver', 125000, 3, , 'image/jpeg', '41mm 18k rose gold case (7.45mm thickness)\r\n', 'Handcrafted blue grand feu enamel dial', '30m water resistance', 'Engine-turned gold rotor', '80-hour power reserve', 'Ultra-thin flying tourbillon (3Hz)', 'A masterpiece of ultra-thin watchmaking that elevates Abraham-Louis\r\nBreguet\'s original tourbillon invention to new heights of refinement. The 41mm rose gold\r\n\r\ncase, just 7.45mm thick, frames a stunning grand feu enamel dial in midnight blue - a\r\ncolor historically reserved for only the most important Breguet commissions. The flying\r\ntourbillon at 5 o\'clock performs its mesmerizing ballet beneath an open-tipped moon\r\nhand, while the eccentric hours chapter and hand-engraved engine-turned subdials\r\nshowcase Breguet\'s signature decorative arts. The self-winding movement, visible\r\nthrough the sapphire caseback, features gold rotor with hand-hammered \"wave\"\r\ndecoration - a detail requiring over 8 hours of artisan work per movement. This is\r\nhorology as fine art, with every element celebrating Breguet\'s 245-year legacy of\r\ninnovation.');
INSERT INTO `watch` (`id`, `name`, `brand`, `color`, `price`, `stock`, `image`, `image_type`, `spec1`, `spec2`, `spec3`, `spec4`, `spec5`, `spec6`, `description`) VALUES
(12, 'Greubel Forsey Double Tourbillon Technique', 'Greubel Forsey', 'Black', 450000, 3, , 'image/jpeg', '43.5mm white gold case with 7 sapphire crystals\r\n', 'Double tourbillon system (30° incline + 1min rotation)', 'Spherical differential gear system', '72-hour power reserve indicator', 'Hand-engraved movement plates', '50m water resistance', 'A mechanical sculpture that redefines tourbillon technology, featuring two\r\nindependent tourbillons - one rotating every 4 minutes inside a 30-degree inclined cage,\r\nthe other completing a full rotation each minute. The 43.5mm white gold case reveals\r\nthis kinetic artistry through multiple sapphire crystals, including a dramatic side window\r\nshowcasing the inclined tourbillon. The openworked anthracite dial exposes the gear\r\ntrain and spherical differential that averages the two tourbillons\' rates, while the\r\nhand-polished bevels and black polished screws demonstrate watchmaking finishing at\r\nits absolute pinnacle. Limited to just 11 pieces annually, each movement requires over\r\n1,200 hours of hand craftsmanship - including three full weeks just to regulate the twin\r\ntourbillon system. This isn\'t just precision timekeeping; it\'s mechanical poetry in motion.');
